            headers: {
              Authorization: `Bearer ${token}`,
            },
          }
        );
        setStats(res.data);
      } catch (error) {
        console.error("revenue fetch error", error);
      } finally {
        setLoading(false);
      }
    };
    fetchDashboardStats();
  }, []);

  return (
    <div className="home">
      <p className="home-subtitle">Track performance, members & growth</p>
      <div className="stats">
        <div className="card">
          <h3>Total Members</h3>
          <p>{stats.totalUsers}</p>
          <span className="card-note">+2 this month</span>
        </div>

        <div className="card">
          <h3>Active Members</h3>
          <p>{stats.activeUsers}</p>
