        </div>
      </div>

      <div className="section">
        <h2>Today‚Äôs Attendance</h2>
        <div className="attendance">
          <div className="attendance-card">
            <h4>Morning Batch</h4>
            <p>124 Members</p>
          </div>
          <div className="attendance-card">
            <h4>Evening Batch</h4>
            <p>176 Members</p>
          </div>
          <div className="attendance-card">
            <h4>Personal Training</h4>
            <p>42 Sessions</p>
          </div>
        </div>
      </div>

      {/* Activity Section */}
      <div className="section">
        <h2>Recent Gym Activity</h2>
