          <li>üí™ New member joined: Rahul Sharma</li>
          <li>üèãÔ∏è Trainer assigned to 5 members</li>
          <li>üî• HIIT batch fully booked</li>
          <li>üí≥ Monthly subscription renewed</li>
        </ul>
      </div>
    </div>
  );
}

export default Home;
